-- QRTZ_TRIGGERS definition
CREATE TABLE `QRTZ_TRIGGERS` ( `sched_name` varchar(120) NOT NULL COMMENT '调度名称', `trigger_name` varchar(200) NOT NULL COMMENT '触发器的名字', `trigger_group` varchar(200) NOT NULL COMMENT '触发器所属组的名字', `job_name` varchar(200) NOT NULL COMMENT 'qrtz_job_details表job_name的外键', `job_group` varchar(200) NOT NULL COMMENT 'qrtz_job_details表job_group的外键', `description` varchar(250) DEFAULT NULL COMMENT '相关介绍', `next_fire_time` bigint(20) DEFAULT NULL COMMENT '上一次触发时间（毫秒）', `prev_fire_time` bigint(20) DEFAULT NULL COMMENT '下一次触发时间（默认为-1表示不触发）', `priority` int(11) DEFAULT NULL COMMENT '优先级', `trigger_state` varchar(16) NOT NULL COMMENT '触发器状态', `trigger_type` varchar(8) NOT NULL COMMENT '触发器的类型', `start_time` bigint(20) NOT NULL COMMENT '开始时间', `end_time` bigint(20) DEFAULT NULL COMMENT '结束时间', `calendar_name` varchar(200) DEFAULT NULL COMMENT '日程表名称', `misfire_instr` smallint(6) DEFAULT NULL COMMENT '补偿执行的策略', `job_data` blob DEFAULT NULL COMMENT '存放持久化job对象', PRIMARY KEY (`sched_name`, `trigger_name`, `trigger_group`) USING BTREE, KEY `sched_name` (`sched_name`, `job_name`, `job_group`) USING BTREE, CONSTRAINT `QRTZ_TRIGGERS_ibfk_1` FOREIGN KEY (`sched_name`, `job_name`, `job_group`) REFERENCES `QRTZ_JOB_DETAILS` (`sched_name`, `job_name`, `job_group`) ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COMMENT ='触发器详细信息表';
