CREATE TABLE `QRTZ_SIMPLE_TRIGGERS` ( `sched_name` varchar(120) NOT NULL COMMENT '调度名称', `trigger_name` varchar(200) NOT NULL COMMENT 'qrtz_triggers表trigger_name的外键', `trigger_group` varchar(200) NOT NULL COMMENT 'qrtz_triggers表trigger_group的外键', `repeat_count` bigint(20) NOT NULL COMMENT '重复的次数统计', `repeat_interval` bigint(20) NOT NULL COMMENT '重复的间隔时间', `times_triggered` bigint(20) NOT NULL COMMENT '已经触发的次数', PRIMARY KEY (`sched_name`, `trigger_name`, `trigger_group`) USING BTREE, CONSTRAINT `QRTZ_SIMPLE_TRIGGERS_ibfk_1` FOREIGN KEY (`sched_name`, `trigger_name`, `trigger_group`) REFERENCES `QRTZ_TRIGGERS` (`sched_name`, `trigger_name`, `trigger_group`) ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COMMENT ='简单触发器的信息表';
-- QRTZ_SIMPROP_TRIGGERS definition
CREATE TABLE `QRTZ_SIMPROP_TRIGGERS` ( `sched_name` varchar(120) NOT NULL COMMENT '调度名称', `trigger_name` varchar(200) NOT NULL COMMENT 'qrtz_triggers表trigger_name的外键', `trigger_group` varchar(200) NOT NULL COMMENT 'qrtz_triggers表trigger_group的外键', `str_prop_1` varchar(512) DEFAULT NULL COMMENT 'String类型的trigger的第一个参数', `str_prop_2` varchar(512) DEFAULT NULL COMMENT 'String类型的trigger的第二个参数', `str_prop_3` varchar(512) DEFAULT NULL COMMENT 'String类型的trigger的第三个参数', `int_prop_1` int(11) DEFAULT NULL COMMENT 'int类型的trigger的第一个参数', `int_prop_2` int(11) DEFAULT NULL COMMENT 'int类型的trigger的第二个参数', `long_prop_1` bigint(20) DEFAULT NULL COMMENT 'long类型的trigger的第一个参数', `long_prop_2` bigint(20) DEFAULT NULL COMMENT 'long类型的trigger的第二个参数', `dec_prop_1` decimal(13, 4) DEFAULT NULL COMMENT 'decimal类型的trigger的第一个参数', `dec_prop_2` decimal(13, 4) DEFAULT NULL COMMENT 'decimal类型的trigger的第二个参数', `bool_prop_1` varchar(1) DEFAULT NULL COMMENT 'Boolean类型的trigger的第一个参数', `bool_prop_2` varchar(1) DEFAULT NULL COMMENT 'Boolean类型的trigger的第二个参数', PRIMARY KEY (`sched_name`, `trigger_name`, `trigger_group`) USING BTREE, CONSTRAINT `QRTZ_SIMPROP_TRIGGERS_ibfk_1` FOREIGN KEY (`sched_name`, `trigger_name`, `trigger_group`) REFERENCES `QRTZ_TRIGGERS` (`sched_name`, `trigger_name`, `trigger_group`) ) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COMMENT ='同步机制的行锁表';

-- blacklist definition
CREATE TABLE IF NOT EXISTS `blacklist` ( `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键', `ip` varchar(255) DEFAULT NULL COMMENT 'IP', `disable_time` datetime DEFAULT NULL COMMENT '黑名单结束时间', `create_time` datetime DEFAULT NULL COMMENT '创建时间', `update_time` datetime DEFAULT NULL COMMENT '更新时间', `del_flag` tinyint(1) DEFAULT 0 COMMENT '是否删除(1未删除；0已删除)', PRIMARY KEY (`id`) USING BTREE ) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='IP黑名单';
-- sys_log definition
CREATE TABLE IF NOT EXISTS `sys_log` ( `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增主键', `data` longtext DEFAULT NULL COMMENT '内容', `create_time` datetime DEFAULT NULL COMMENT '创建时间', PRIMARY KEY (`id`) USING BTREE ) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT='系统日志';
